import s from './EventsSection.module.css';

const EventsSection = () => {
	return (
		<div className={s.events}>
			<h3>Події</h3>

			<div className={s.events_list}>
				<div className={s.events_item}>
					<div>
						<img src="" alt="" />
					</div>
					<div>
						<p></p>
						<div>
							<p></p>
							button
						</div>
					</div>
				</div>
			</div>
		</div>
	);
};

export default EventsSection;
